import React from 'react';
import styled from "styled-components";

import AppBar from '../components/AppBar';
export default function Notice() {
    return (
        <div>
            <WrapBox>
            <AppBar/>
            즐겨찾기 페이지입니다.
            </WrapBox>
        </div>
    );
}

const WrapBox = styled.div`
  background: linear-gradient(to bottom, #000000, #4f4f51);
  min-height: 100%;
  max-width: 1500px;
  margin: 0px auto;
`;
